import React from "react";
import { Link } from "react-router-dom";
import "./Button.css"
function Button() {
    return(
        <a href="https://www.portnet.ma/fr/creation-compte">
            <button className="btn">ACCÈS GUICHET UNIQUE</button>
        </a>
    )
}

export default Button;


